import "./MealExhibition.css"

function MealExhibiton(props) {
    return (
        <div className="meal-exhibition">
            <div className="meal-image">
                {/* <img src={props.image} alt={props.title}/> */}
            </div>
            <h1>{props.title}</h1>
            <p>{props.description}</p>
            <h2>{props.price}</h2>
        </div>
    )
}

export default MealExhibiton
